import React, { useState, useEffect } from 'react';

function Api() {
    const [recipes, setRecipes] = useState([]);
    useEffect(() => {
        fetch('https://gastronomia-api.herokuapp.com/recipes')
        .then(res => res.json())
        .then(data => {
            console.log(data)
            setRecipes(data)
        })
    }, [])

    return (
        <div>
            <div>{recipes.map(recipe => (
            <div key={recipe.id}>Title: <span>{recipe.title}</span></div>
            ))}</div>
        </div>
    );
}

export default Api;
